    getInfoPersonal() {
        //Aquí se llama al servicio para obtener los datos personales
        this.cargandoTabla = true;
        this._portalSociosService.getSocioLogeado().subscribe(response => {
            this.infoPersonal = response;
            this.cargandoTabla = false;
        }, error => {
            console.log(error);
            this.cargandoTabla = false;
        });
    }
